import React, { Component } from 'react';
import Header from './Header';
import "./../App.css";
import Footer from './Footer';
import Content from './Content';

class App extends Component {

  render() {
    return (
      <div className="container-fluid">
        <Header></Header>
        <br/><br/><br/>


        <Content></Content>
        <Footer></Footer>
      </div>
    )

  }
}

export default App;
